import React from 'react'
import Carousel from 'react-whirligig'
import Card from '../components/Card'



class Slider extends React.Component {     
    render() {
        const Slider = () => {
            let carousel
            const next = () => carousel.next()
            const prev = () => carousel.prev()
        }
      return (
        <div>
      <button onClick={prev}>Prev</button>
      <Carousel
        visibleSlides={3}
        gutter="1em"
        ref={(_whirligigInstance) => { carousel = _whirligigInstance}}
      >
        <img src="http://www.fillmurray.com/400/300" />
        <img src="http://www.fillmurray.com/300/400" />
        <img src="http://www.fillmurray.com/400/200" />
        <img src="http://www.fillmurray.com/200/400" />
        <img src="http://www.fillmurray.com/500/300" />
      </Carousel>
      <button onClick={next}>Next</button>
    </div>
      );
    }
  }

  export default Slider;
